import React from 'react';

import PageTitle from '../components/PageTitle';
import ResetPw from '../components/ResetPw';

const ResetPwPage = () =>
{
    return(
        <div>
            <PageTitle />
            <ResetPw />
        </div>
    );
};

export default ResetPwPage;
